import React from "react";



const UserData =(props) => {
  return (
<ul>
  {props.userData.map(userData => (
    <li key = {props.UserData.id}>
      {props.UserData.winner}{props.UserData.date}
      </li>
    ))}
</ul>
  );
  }





export default UserData;
